  "createdAt":"2023-09-01T12:29:03+00:00",
  "embed":{"$type":"app.bsky.embed.external","external":{"uri":"https://www.nhnieuws.nl/nieuws/324060/nh-vernieuwt-radioprogrammering","thumb":{"ref":{"value":{"type":"Buffer","data":[0,1,85,18,32,210,145,209,134,18,221,128,219,181,135,95,57,135,255,175,14,119,13,113,140,151,126,205,153,139,208,40,183,87,44,213,9]},"tag":42},"size":23527,"$type":"blob","mimeType":"image/jpeg"},"title":"NH vernieuwt radioprogrammering","description":"Vanaf maandag 4 september start de nieuwe radioprogrammering waarmee luisteraars nog beter op de hoogte blijven van het laatste nieuws mooie achtergrondverhalen leuke gasten en heerlijke muziek Hetzelfde vertrouwde geluid in een nieuw jasje Zo ben jij waar je ook gaat altijd in goed gezelschap met NH RadioIn de vernieuwde programmering wordt de luisteraar als vanouds wakker met De Ontbijttafel met Pieter Kok waarna Bart Slim je in Goeiemorgen met heerlijke muziek door de rest van de ochtend loodstJune Hoogcarspel verzorgt een smakelijke lunch met June Tot Twee Vervolgens neemt Nick Velderman het stokje over in een muzikale Goeiemiddag met herkenbare liedjes van toen n nieuwe hits Patricia Nagelkerke brengt je tot slot richting de avond in Vandaag De Dag met het meest spraakmakende nieuws uit NoordHollandDe nieuwe verdelingen van de uren sluit volgens eindredacteur Koen Maas nog beter aan bij de luisteraar Er zit een betere balans in de programmering waardoor je als zender meegaat in het ritme van je luisteraar aldus MaasGroot netwerkRadio is al sinds jaar en dag een van de pijlers van NH waarbij bevlogen radiomakers en verslaggevers in de regio de verhalen brengen die leven in de provincie Met een groot netwerk in de verschillende regios weet NH steevast de luisteraar te boeien met een goede mix van achtergrondverhalen hard nieuws en heerlijke muziekLuister hier naar NH of kijk hier op welke frequentie je ons kunt vinden"}},
